import React from 'react'
import Badge from '@mui/material/Badge';
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import ShoppingCartOutlined from '@mui/icons-material/ShoppingCartOutlined';
import { useState } from 'react';
//import { AiOutlineShoppingCart  } from 'react-icons/ai';

export default function Nav() {

  const [itemCount, setItemCount] = useState(0)

  return (
        <div className='navbar'>
        <div className='logo'>
        <img src="sport_images/logo.png" alt="logo" />
        </div>
        <div className='d-none d-sm-none d-md-block'>
          <ul>
            <li className='brd'>HOME</li>
            <li className='brd'>COMPANY</li>
            <li className='brd'>SPORTS STARS</li>
            <li>PRODUCTS</li>
            <li onClick={() => setItemCount(itemCount+1)}> <Badge color="secondary" badgeContent={itemCount}>
             { itemCount !== 0 ? <ShoppingCartIcon /> : <ShoppingCartOutlined /> } {" "} 
        </Badge></li>
          </ul>
          </div>
      </div>
  )
}
